import React from 'react';
import s from './my-posts.module.css';

import Post from '../my-posts'

const MyPosts = () => {
    return(
          <div className={s.posts}>
              My posts
              <div >
                  <Post />
              </div>
          </div>
    )
};

export default MyPosts;
